import React, { Component } from "react";
import { VictoryLine, VictoryChart } from "victory";
import compHistory from './functions/compHistory';

export default class Tacos extends Component {
  constructor() {
    super();
    this.state = {
        data: [
          {}
        ]
      };
    }
  componentDidMount() {
    let chart = compHistory("AAPL",1)
    console.log(chart)
    const newData = {
        date: new Date(),
        num: Math.floor(Math.random() * 5) + 1
      }
    this.state = {
        data: chart
    }
    }
  render() {
    return (
      <div>
        <h1>Tacos per Day</h1>
        <VictoryChart>
          <VictoryLine
            data={this.state.data}
            style={{
              data: {
                stroke: "#02B875"
              }
            }}
          />
        </VictoryChart>
      </div>
    );
  }
}
